import User from "./User";

const Detail = () => {
  const onSubmit = (event) => {
    event.preventDefault();
    console.log("aa");
  };
  return (
    <>
      <h1>Detail Page</h1>
      <form onSubmit={onSubmit}>
        <input type="text" placeholder="Write Username"></input>
        <button type="submit">Submit</button>
      </form>

      <User></User>
    </>
  );
};

export default Detail;
